import React from "react";
import { Typography, Button, ThemeProvider } from "@mui/material";
import { createTheme } from "@mui/material";
import PhoneIcon from "@mui/icons-material/Phone";

const { palette } = createTheme();
const { augmentColor } = palette;
const createColor = (mainColor) => augmentColor({ color: { main: mainColor } });
const theme = createTheme({
  palette: {
    anger: createColor("#F40B27"),
    apple: createColor("#5DBA40"),
    steelBlue: createColor("#5C76B7"),
    violet: createColor("#BC00A3"),
  },
});

function Navbar(props) {
  return (
    <div>
      <header className="header">
        <div style={{ marginLeft: 60 }}>
          <img
            src="https://idreamcareer.com/wp-content/uploads/2021/08/small-logo-1.webp"
            height="50px"
            width="80px"
          />
        </div>
        <div className="h2">
          <div className="h1">
            <Typography style={{ color: "blue", textDecoration: "underline" }}>
              Home
            </Typography>
          </div>
          <div className="h1">
            <Typography>9th-10th</Typography>
          </div>
          <div className="h1">
            <Typography>11th-12th</Typography>
          </div>
          <div className="h1">
            <Typography>Undergraduate</Typography>
          </div>
          <div className="h1">
            <Typography>Study Abroad</Typography>
          </div>
          <div className="h1">
            <Typography>Blog</Typography>
          </div>
          <div className="h1">
            <PhoneIcon />
          </div>
          <div style={{ margin: 15 }}>
            {/* <ThemeProvider theme={theme}> */}
            <Button variant="contained" size="large" color="apple">
              Book Now
            </Button>
            {/* </ThemeProvider> */}
          </div>
        </div>
      </header>
    </div>
  );
}

export default Navbar;
